        elif option == "OneLevel":
            if any(value == "/" and len(what.split("/")) == 2 for value in values):
                continue
            elif any(
                value != "/"
                and what.startswith(value + "/")
                and len(what.split("/")) - 1 == len(value.split("/"))
                for value in values
            ):
                continue
            else:
                return False
        elif option == "Recursive":
            if any(value == "/" for value in values):
                continue
            elif any(what.startswith(value + "/") for value in values):
                continue
            else:
                return False

    # Check tag filters
    for tag_key, tag_values in tag_filters.items():
        tag_match_found = False
        for tag in parameter.tags:
            if tag["Key"] == tag_key and tag["Value"] in tag_values:
                tag_match_found = True
                break
        if not tag_match_found:
            return False

    # True if no false match (or no filters at all)
    return True
